import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <div>
      <ul>
        <li>
          <Link to="/">Home Page</Link>
        </li>
        <li>
          <Link to="/add">Add Details</Link>
        </li>
        <li>
          <Link to="/update">Update Details</Link>
        </li>
        <li>
          <Link to="/delete">Delete Details</Link>
        </li>
      </ul>
    </div>
  );
};

export default Nav;
